#!/usr/bin/env python
import rospy
from std_msgs.msg import String
from turtlesim.msg import Pose

def callback(data):
    rospy.loginfo(rospy.get_caller_id() + ":: %.2f %.2f", data.x, data.y)

def listener():
    rospy.init_node('listener', anonymous=True)

    rospy.Subscriber("/turtle1/pose", Pose, callback)

    rospy.spin()

if __name__ == '__main__':
    listener()

#include "ros/ros.h"
#include "std_msgs/String.h"
#include "geometry_msgs/Twist.h"

#include <sstream>

int main(int argc, char **argv)
{
  ros::init(argc, argv, "talker");
  ros::NodeHandle n;

  ros::Publisher chatter_pub = n.advertise<geometry_msgs::Twist>("/turtle1/cmd_vel", 1);
  ros::Rate loop_rate(1);

  while (ros::ok())
  {
    geometry_msgs::Twist msg;
    msg.linear.x = 2.0;
    msg.linear.y = 2.0;
    msg.linear.z = 2.0;

    msg.angular.x = 0.0;
    msg.angular.y = 0.0;
    msg.angular.z = 1.8;

    chatter_pub.publish(msg);
    loop_rate.sleep();
  }


  return 0;
}

#include "ros/ros.h"
#include "std_msgs/String.h"
#include "turtlesim/Pose.h"
#include <iostream>

void chatterCallback(turtlesim::Pose msg)
{
  ROS_INFO("[L] %.4f, %.4f", msg.x, msg.y);
}

int main(int argc, char **argv)
{
  ros::init(argc, argv, "listener");

  ros::NodeHandle n;

  ros::Subscriber sub = n.subscribe<turtlesim::Pose>("/turtle1/pose", 1000, chatterCallback);

  ros::spin();

  return 0;
}
